import React, { Component } from 'react';
import $ from "jquery";

class RegistrosSalvos extends React.Component {

    constructor(props) {
        super(props);
        this.state = { date: new Date() };
    }

    render() {
        return (
            <div id = 'listaRegistros'>
                <ul>
                    <li>testando 1 </li>
                    <li>testando 2 </li>
                    <li>testando 3 </li>
                </ul>
            </div>
        );
    }
}

export default RegistrosSalvos;
